import React from 'react';
import Style from "../assets/style/header.css"

const titleStyle = {
    Opacity: "100%",
    fontfamily: "arial",
    color: "blue"
};

function Header() {
    return(
        <div className='Header'>
            <h1 style={titleStyle}>Alex Hickey</h1>
        </div>
    )
};

export default Header
